import "./lodging.css";
import Dropdown from "../Dropdown/dropdown";

function LodgingMain( { id, title, location, description, equipements, tags, host, rating } ) {
    return (
    <div className="lodging">
        <div className="lodgMain-sectionLeft">
            <h1 className="lodgMain-title">{title}</h1>
            <h2 className="lodgMain-location">{location}</h2>
        </div>

        <section className="section_dropdown section_dropdown_about">
            <Dropdown
                title="Description"
                contents= {description}
                />
            <Dropdown
                title="Equipements"
                contents={equipements}
                />
        </section>
    </div>
    )
}

export default LodgingMain
